tables.table_schema:
CREATE TABLE robotic_arm_analysis (
  analysis_id INT PRIMARY KEY,
  sensor_id INT,
  analysis_result VARCHAR(255),
  FOREIGN KEY (sensor_id) REFERENCES robotic_arm_sensor_data(sensor_id)
);

CREATE TABLE sensor_data (
  sensor_id UUID PRIMARY KEY,
  timestamp TIMESTAMP,
  arm_position VARCHAR,
  temperature FLOAT
);

CREATE TABLE optimization_results (
  optimization_id UUID PRIMARY KEY,
  calibration_id UUID,
  efficiency FLOAT,
  cost FLOAT
);

CREATE TABLE sensor_readings (
  id SERIAL PRIMARY KEY,
  timestamp TIMESTAMPTZ NOT NULL,
  sensor_id VARCHAR(50) NOT NULL,
  sensor_value FLOAT NOT NULL
);

CREATE TABLE arm_statistics (
  id SERIAL PRIMARY KEY,
  timestamp TIMESTAMPTZ NOT NULL,
  total_movements INT NOT NULL,
  average_intensity FLOAT NOT NULL
);
